import React from 'react';
import { Nav, Navbar, Form, Button } from 'react-bootstrap';
import '../../../node_modules/bootstrap/dist/css/bootstrap.min.css'

const Navbars = () => {
  return (
    <div>
      <Navbar bg="transparrent" expand="lg">

        <Navbar.Brand href="#home">
        <img
          src="/logo.svg"
          width="30"
          height="30"
          className="d-inline-block align-top"
          alt="Logo"
        />
      </Navbar.Brand>

    <Form inline >
      <input className="searchControl  ml-5" width="35"
          height="35" type="text"></input>
      <Button className="ml-2" variant="outline-success">Search</Button>
    </Form>
  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav">
   
    <Nav >
      <Nav.Link className="ml-5" href="#home">Home</Nav.Link>
      <Nav.Link className="ml-5" href="#link">Link</Nav.Link>
      <Nav.Link className="ml-5" href="#home">Home</Nav.Link>
      <Nav.Link className="ml-5" href="#link">Link</Nav.Link>
      <Nav.Link className="ml-5" href="#home">Home</Nav.Link>
      <Nav.Link className="ml-5" href="#link">Link</Nav.Link>
      <Form inline>
    <Button className="ml-5" type="submit">Submit</Button>
     </Form>
    </Nav>
   
  </Navbar.Collapse>
</Navbar>

    </div>
  );
};

export default Navbars;


